<!doctype html>
<html lang="en">
    <head>
        <meta charset="utf-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <meta name="viewport" content="initial-scale=1,user-scalable=no,maximum-scale=1,width=device-width">
        <meta name="mobile-web-app-capable" content="yes">
        <meta name="apple-mobile-web-app-capable" content="yes">
        <link rel="stylesheet" href="css/leaflet.css">
        <link rel="stylesheet" href="css/qgis2web.css"><link rel="stylesheet" href="css/fontawesome-all.min.css">
        <style>
        html, body, #map {
            width: 100%;
            height: 100%;
            padding: 0;
            margin: 0;
        }
        </style>
        <title></title>
    </head>
    <body>
        <div id="map">
        </div>
        <script src="js/qgis2web_expressions.js"></script>
        <script src="js/leaflet.js"></script>
        <script src="js/leaflet.rotatedMarker.js"></script>
        <script src="js/leaflet.pattern.js"></script>
        <script src="js/leaflet-hash.js"></script>
        <script src="js/Autolinker.min.js"></script>
        <script src="js/rbush.min.js"></script>
        <script src="js/labelgun.min.js"></script>
        <script src="js/labels.js"></script>
        <script>
        var map = L.map('map', {
            zoomControl:true, maxZoom:28, minZoom:1
        }).fitBounds([[-47.04121010576878,95.56244815345251],[1.5090019188017476,170.30259643555195]]);
        var hash = new L.Hash(map);
        map.attributionControl.setPrefix('<a href="https://github.com/tomchadwin/qgis2web" target="_blank">qgis2web</a> &middot; <a href="https://leafletjs.com" title="A JS library for interactive maps">Leaflet</a> &middot; <a href="https://qgis.org">QGIS</a>');
        var autolinker = new Autolinker({truncate: {length: 30, location: 'smart'}});
        var bounds_group = new L.featureGroup([]);
        function setBounds() {
        }
        map.createPane('pane_ESRIGraylight_0');
        map.getPane('pane_ESRIGraylight_0').style.zIndex = 400;
        var layer_ESRIGraylight_0 = L.tileLayer('http://services.arcgisonline.com/ArcGIS/rest/services/Canvas/World_Light_Gray_Base/MapServer/tile/{z}/{y}/{x}', {
            pane: 'pane_ESRIGraylight_0',
            opacity: 1.0,
            attribution: '',
            minZoom: 1,
            maxZoom: 28,
            minNativeZoom: 0,
            maxNativeZoom: 20
        });
        layer_ESRIGraylight_0;
        map.addLayer(layer_ESRIGraylight_0);
        map.createPane('pane_66K228K_1');
        map.getPane('pane_66K228K_1').style.zIndex = 401;
        var img_66K228K_1 = 'data/66K228K_1.png';
        var img_bounds_66K228K_1 = [[-43.740509603,96.816941394],[-9.140509603000003,167.9969413940003]];
        var layer_66K228K_1 = new L.imageOverlay(img_66K228K_1,
                                              img_bounds_66K228K_1,
                                              {pane: 'pane_66K228K_1'});
        bounds_group.addLayer(layer_66K228K_1);
        map.addLayer(layer_66K228K_1);
        map.createPane('pane_66K_2');
        map.getPane('pane_66K_2').style.zIndex = 402;
        var img_66K_2 = 'data/66K_2.png';
        var img_bounds_66K_2 = [[-43.740509603,96.816941394],[-9.140509603000003,167.9969413940003]];
        var layer_66K_2 = new L.imageOverlay(img_66K_2,
                                              img_bounds_66K_2,
                                              {pane: 'pane_66K_2'});
        bounds_group.addLayer(layer_66K_2);
        map.addLayer(layer_66K_2);
        map.createPane('pane_57K_3');
        map.getPane('pane_57K_3').style.zIndex = 403;
        var img_57K_3 = 'data/57K_3.png';
        var img_bounds_57K_3 = [[-43.740509603,96.816941394],[-9.140509603000003,167.9969413940003]];
        var layer_57K_3 = new L.imageOverlay(img_57K_3,
                                              img_bounds_57K_3,
                                              {pane: 'pane_57K_3'});
        bounds_group.addLayer(layer_57K_3);
        map.addLayer(layer_57K_3);
        map.createPane('pane_52K_4');
        map.getPane('pane_52K_4').style.zIndex = 404;
        var img_52K_4 = 'data/52K_4.png';
        var img_bounds_52K_4 = [[-43.740509603,96.816941394],[-9.140509603000003,167.9969413940003]];
        var layer_52K_4 = new L.imageOverlay(img_52K_4,
                                              img_bounds_52K_4,
                                              {pane: 'pane_52K_4'});
        bounds_group.addLayer(layer_52K_4);
        map.addLayer(layer_52K_4);
        map.createPane('pane_047K_5');
        map.getPane('pane_047K_5').style.zIndex = 405;
        var img_047K_5 = 'data/047K_5.png';
        var img_bounds_047K_5 = [[-43.740509603,96.816941394],[-9.140509603000003,167.9969413940003]];
        var layer_047K_5 = new L.imageOverlay(img_047K_5,
                                              img_bounds_047K_5,
                                              {pane: 'pane_047K_5'});
        bounds_group.addLayer(layer_047K_5);
        map.addLayer(layer_047K_5);
        var baseMaps = {};
        L.control.layers(baseMaps,{"0 - 47K": layer_047K_5,"> 52K": layer_52K_4,"> 57K": layer_57K_3,"> 66K": layer_66K_2,"66K - 228K": layer_66K228K_1,"ESRI Gray (light)": layer_ESRIGraylight_0,},{collapsed:false}).addTo(map);
        setBounds();
        L.ImageOverlay.include({
            getBounds: function () {
                return this._bounds;
            }
        });
        </script>
    </body>
</html>
